export default class Run {

	constructor(aid, adate, aiduser){
        this.id = aid
        this.date = adate
        this.iduser = aiduser	
    }

    static fromJSON(run) {
		let results = null;
		if (Array.isArray(run)) {
			results = [];
			run.forEach((x) => {
				Object.setPrototypeOf(x, Run.prototype);
				results.push(x);
			})
		} else {
			let x = run;
			Object.setPrototypeOf(x, Run.prototype);
			results = x;
		}
		return results;
	}
}
